import * as React from "react";
import { ButtonGroup } from "@mui/material";
import { Checkbox } from "@mui/material";
import { TextField } from "@mui/material";
import './Stylesheets/LoginForm.css';
import { Stack, Paper, Grid, Button, Box } from "@mui/material";

function LoginForm(){
    return <Box sx={{mt:5}} gap={7} display="flex" flexDirection="column" justifyContent="center" ><TextField label="Login" sx={{mr:5, ml:5}} variant="standard" size="small"></TextField>
                              <TextField label="Password" sx={{mr:5, ml:5}} variant="standard" size="small"></TextField> <Button>Log In</Button></Box>;
}

export default LoginForm;
